// client/src/App.js

import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/getAllNotes").then((response) => {
      if (response.ok) {
        return response.json();
      }
      throw new Error("Error " + response.status + " al llamar al API: " + response.statusText);
    })
    .then((responseJson) => {
      console.log(responseJson);
      setData(responseJson);
    })
    .catch((error) => {
      console.error(error)
    });
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>{!data ? "Loading..." : data}</p>
      </header>
      <div>
        {data != null ? (
          <ul>
            {data.map((note, index) => (
              <li key={index}>
                <strong>ID:</strong> {note.id}<br />
                <strong>Nombre:</strong> {note.nombre}<br />
                <strong>Descripci√≥n:</strong> {note.descripcion}<br />
              </li>
            ))}
          </ul>
        ) : (
          <p>No hay datos disponibles.</p>
        )}
      </div>
    </div>
  );
}

export default App;
